import styled from "styled-components";


export const ContainerNav = styled.div`
  width: 100vw;
  height: 100vh;
  display: flex;
  justify-content: center;
  align-items: center;
  position: relative;
  overflow: hidden;
`;

export const ImageNav = styled.img`
  width: 100%;
  height: 100%;
  position: absolute;
  z-index: -1;
`;
